import React from 'react';
import styled from 'styled-components';

const Title =styled.h2`
width: 180px;
border-bottom: 3px solid rgb(3, 28, 28);
font-family: sans-serif;
letter-spacing: 0.1em;
`

const ds = () => {
  return (
  <Title>DANH SÁCH ĐỘNG VẬT</Title>)
  ;
};

export default ds;
